INSERT INTO "MLPNews" VALUES(16,'EPD','Enterprise to Provide Marine Transportation Services for ExxonMobil Subsidiary under Multi-Year Deal','HOUSTON--(BUSINESS WIRE)--Jan. 15, 2013-- Enterprise Products Partners L.P. (NYSE: EPD) today announced that its wholly owned affiliate, Enterprise Marine Services LLC, has entered into a multi-year contract with SeaRiver, Inc. to provide the ExxonMobil subsidiary with transportation services. Under the terms of the agreement, which took effect January 1, 2013, Enterprise is committing five tugs and 10 barges for the transportation of refined products and other hydrocarbon products along the nation’s inland waterway system. 
